import React from "react";
import ModalImage from "react-modal-image";

export default function ProfilePhoto(props) {
  return (
    <>
      <div className="home-photo">
        <div
          className="hp-inner"
          style={{ backgroundImage: `url( ${props.url})` }}
        >
          <ModalImage large={props.url} alt="" />
        </div>
      </div>
    </>
  );
}
